package Bean;public class StuBena {	private String stuName;	private String stuSex;	private int stuNo;	private String sutClass;	private String stuDromNo;		public String getStuName() {		return stuName;	}	public void setStuName(String stuName) {		this.stuName = stuName;	}	public String getStuSex() {		return stuSex;	}	public void setStuSex(String stuSex) {		this.stuSex = stuSex;	}	public int getStuNo() {		return stuNo;	}	public void setStuNo(int stuNo) {		this.stuNo = stuNo;	}	public String getSutClass() {		return sutClass;	}	public void setSutClass(String sutClass) {		this.sutClass = sutClass;	}	public String getStuDromNo() {		return stuDromNo;	}	public void setStuDromNo(String stuDromNo) {		this.stuDromNo = stuDromNo;	}			}